import styles from "../styles/Method.module.css";
import designprocess from "../assets/designprocess.png";
import designsprint from "../assets/designsprint.png";

function Oandalive() {
    return (
        <section className={styles.method}>
            <h1>Design Method</h1>
            <p>
                Throughout my whole career, I've always worked in a way that's similar to the Double Diamond design model. Where it's dividied in 4 categories of Discover, Define, Develop, Deliver. However the on
            </p>
            <img src={designprocess} className={styles.methodImg} alt="OANDA metrics" />


            <h2>Design Sprints</h2>
            <p>
                One of the key things I enjoy when being a part of a team is doing Design Sprints together. As a manager, we held Design Sprints every Tuesday that anybody in the company can join. The process and days are detailed below with the 3 steps being:
            </p>
            <ul>
                <li>1. Everyone posted ideas and features that they wanted to implemented</li>
                <li>2. The idea has to be feasible and can be done in a week</li>
                <li>3. If successful during user testing, it'll be implemented into the app!</li>
            </ul>
            <img src={designsprint} className={styles.methodImg} alt="OANDA metrics" />

        </section>
    );
}

export default Oandalive;
